import{_ as e,c as a,q as r,o as l}from"./chunks/framework.BRsttz9t.js";const n="/assets/pp-coffee.B6ybez7E.jpeg",u=JSON.parse('{"title":"PaddlePaddle Hackathon Episode 02 | 第五期活动上线 8 周，框架赛道提交率近 90%","description":"","frontmatter":{"title":"PaddlePaddle Hackathon Episode 02 | 第五期活动上线 8 周，框架赛道提交率近 90%","date":"2023-12-01T00:00:00.000Z","author":{"name":"梦师傅","github":"Ligoml"},"co_authors":[{"name":"花花","github":"Tulip-hua"}],"category":"community-activity"},"headers":[],"relativePath":"posts/hackathon-5th-episode02.md","filePath":"posts/hackathon-5th-episode02.md"}'),d={name:"posts/hackathon-5th-episode02.md"};function i(s,t,o,h,c,g){return l(),a("div",null,[...t[0]||(t[0]=[r('<p>向大家快速介绍飞桨黑客松第五期开展以来的进展（11.4-12.1）</p><p>为了吸引社区开发者了解与参与飞桨深度学习开源项目与文心大模型开发实践，为飞桨框架、套件、大模型、合作伙伴等生态进行开源贡献，进一步扩大飞桨开源生态与文心大模型应用生态，我们组织了 <strong>PaddlePaddle Hackathon 飞桨黑客松第五期活动</strong>。活动开展 8 周的进展速览如下：</p><ul><li><strong>开源贡献个人挑战赛</strong>：发布 110 个开源贡献任务，包括框架、科学计算、套件和合作伙伴方向，与 OpenVINO™、海光、Arm、高通、Zilliz、开放麒麟社区、9#AISoft 等合作项目共同出品，<strong>全部任务完成认领，72 个任务提交作品，32 个任务已经完成</strong>，框架方向提交率近 90%，科学计算方向提交率 70%+，进展超出预期，感谢各位开发者的积极参与，感谢各位导师的及时 review。</li><li><strong>大模型应用与创意赛</strong>：作为飞桨星河社区五周年预热活动，目标挖掘优质文心一言应用，共发布趣味创意与生产力工具 2 个方向的任务，<strong>已有 22 名开发者产出基于 EB SDK 的应用 34 个，均已部署至应用中心</strong>。</li><li><strong>飞桨护航计划集训营</strong>：共有 22 名社区开源开发者在社区导师的指导下，进行飞桨开源项目开发。 <strong>按期完成了两期双周报提交，完成了 3 期技术分享，成果全部沉淀到开源社区</strong>。</li></ul><h3 id="赛道一-开源贡献个人挑战赛" tabindex="-1">赛道一：开源贡献个人挑战赛 <a class="header-anchor" href="#赛道一-开源贡献个人挑战赛" aria-label="Permalink to &quot;赛道一：开源贡献个人挑战赛&quot;">​</a></h3><h4 id="进度看板" tabindex="-1">进度看板 <a class="header-anchor" href="#进度看板" aria-label="Permalink to &quot;进度看板&quot;">​</a></h4><table tabindex="0"><thead><tr><th style="text-align:center;">任务方向</th><th style="text-align:center;">任务数量</th><th style="text-align:center;">提交作品 / 任务认领</th><th style="text-align:center;">提交率</th><th style="text-align:center;">完成</th><th style="text-align:center;">完成率</th></tr></thead><tbody><tr><td style="text-align:center;">热身赛</td><td style="text-align:center;">11</td><td style="text-align:center;">10 / 11</td><td style="text-align:center;">90.91%</td><td style="text-align:center;">4</td><td style="text-align:center;">36.36%</td></tr><tr><td style="text-align:center;">框架 API 开发任务</td><td style="text-align:center;">31</td><td style="text-align:center;">28 / 31</td><td style="text-align:center;">90.32%</td><td style="text-align:center;">6</td><td style="text-align:center;">19.35%</td></tr><tr><td style="text-align:center;">框架其他开发任务</td><td style="text-align:center;">16</td><td style="text-align:center;">15 / 16</td><td style="text-align:center;">93.75%</td><td style="text-align:center;">13</td><td style="text-align:center;">81.25%</td></tr><tr><td style="text-align:center;">科学计算模型复现</td><td style="text-align:center;">11</td><td style="text-align:center;">8 / 11</td><td style="text-align:center;">72.73%</td><td style="text-align:center;">4</td><td style="text-align:center;">36.36%</td></tr><tr><td style="text-align:center;">套件开发任务</td><td style="text-align:center;">24</td><td style="text-align:center;">6 / 24</td><td style="text-align:center;">25.0%</td><td style="text-align:center;">3</td><td style="text-align:center;">12.5%</td></tr><tr><td style="text-align:center;">合作伙伴任务</td><td style="text-align:center;">17</td><td style="text-align:center;">5 / 17</td><td style="text-align:center;">29.41%</td><td style="text-align:center;">2</td><td style="text-align:center;">11.76%</td></tr></tbody></table><h4 id="赛道亮点" tabindex="-1">赛道亮点 <a class="header-anchor" href="#赛道亮点" aria-label="Permalink to &quot;赛道亮点&quot;">​</a></h4><ul><li>尽管本期黑客松整体难度较往期提升，但社区开发者表现出了极大的专业能力和热情，任务已经 100% 被大家认领；</li><li>框架方向提交率近 90%，科学计算方向提交率 70%+，均高于往期黑客松。</li></ul><h4 id="参与提示" tabindex="-1">参与提示 <a class="header-anchor" href="#参与提示" aria-label="Permalink to &quot;参与提示&quot;">​</a></h4><ul><li>在上面的看板中能看出来，套件开发任务和合作伙伴开发任务，提交率依然较低，欢迎社区的开发者选择这些任务来挑战。</li></ul><p>更多详情请查看 issue：<a href="https://github.com/PaddlePaddle/Paddle/issues/57262" target="_blank" rel="noreferrer">https://github.com/PaddlePaddle/Paddle/issues/57262</a></p><h3 id="赛道二-大模型应用与创意赛" tabindex="-1">赛道二： 大模型应用与创意赛 <a class="header-anchor" href="#赛道二-大模型应用与创意赛" aria-label="Permalink to &quot;赛道二： 大模型应用与创意赛&quot;">​</a></h3><h4 id="部分应用展示" tabindex="-1">部分应用展示 <a class="header-anchor" href="#部分应用展示" aria-label="Permalink to &quot;部分应用展示&quot;">​</a></h4><p>我们收到了 270 人报名，提交了 34 个应用，在这里节选部分有趣的应用，欢迎大家在线体验。</p><ul><li><a href="https://aistudio.baidu.com/application/detail/8138" target="_blank" rel="noreferrer">基于文心一言 API + 文档的知识问答系统</a></li><li><a href="https://aistudio.baidu.com/application/detail/9577" target="_blank" rel="noreferrer">海龟汤——逆向推理文字游戏</a></li></ul><h4 id="赛道亮点-1" tabindex="-1">赛道亮点 <a class="header-anchor" href="#赛道亮点-1" aria-label="Permalink to &quot;赛道亮点&quot;">​</a></h4><ul><li>社区开发者们基于文心大模型的 SDK： <a href="https://github.com/PaddlePaddle/ERNIE-Bot-SDK" target="_blank" rel="noreferrer">ERNIE Bot SDK</a>，提交了种类多样，涵盖多领域作品，充分探索了使用文心大模型能做到的创意和创新。</li></ul><h4 id="参与提示-1" tabindex="-1">参与提示 <a class="header-anchor" href="#参与提示-1" aria-label="Permalink to &quot;参与提示&quot;">​</a></h4><ul><li>欢迎大家继续发挥创意，提交更多有趣的应用。</li></ul><p>更多详情请查看 issue：<a href="https://github.com/PaddlePaddle/Paddle/issues/57585" target="_blank" rel="noreferrer">https://github.com/PaddlePaddle/Paddle/issues/57585</a></p><h3 id="赛道三-飞桨护航计划集训营" tabindex="-1">赛道三：飞桨护航计划集训营 <a class="header-anchor" href="#赛道三-飞桨护航计划集训营" aria-label="Permalink to &quot;赛道三：飞桨护航计划集训营&quot;">​</a></h3><h4 id="活动进展" tabindex="-1">活动进展 <a class="header-anchor" href="#活动进展" aria-label="Permalink to &quot;活动进展&quot;">​</a></h4><p>集训营的同学已经完成了两次开源开发的双周报： <a href="https://github.com/PFCCLab/Camp/issues/54" target="_blank" rel="noreferrer">WeeklyReports 2023.10.25~2023.11.07</a>、 <a href="https://github.com/PFCCLab/Camp/issues/77" target="_blank" rel="noreferrer">WeeklyReports 2023.11.08~2023.11.21</a> 和三次<a href="https://github.com/PFCCLab/Camp/issues/14" target="_blank" rel="noreferrer">技术分享</a> 。</p><h4 id="集训营亮点" tabindex="-1">集训营亮点 <a class="header-anchor" href="#集训营亮点" aria-label="Permalink to &quot;集训营亮点&quot;">​</a></h4><ul><li>集训营将整个过程以开源的方式公开和协作，学员和导师在线研讨和互相促进。</li><li>社区开发者展现了极高的专业性和热情，详见导师点评：<a href="https://github.com/PFCCLab/Camp/blob/main/WeeklyReports/19_RyanHuang/%5BWeeklyReport%5D2023.11.08~2023.11.21.md#%E5%AF%BC%E5%B8%88%E7%82%B9%E8%AF%84" target="_blank" rel="noreferrer">@Aurelius84</a>、<a href="https://github.com/PFCCLab/Camp/blob/main/WeeklyReports/10_AndSonder/%5BWeeklyReport%5D2023.11.9~2023.11.22.md#%E5%AF%BC%E5%B8%88%E7%82%B9%E8%AF%84" target="_blank" rel="noreferrer">@From00</a>、<a href="https://github.com/PFCCLab/Camp/blob/main/WeeklyReports/06_Wanglongzhi2001/%5BWeeklyReport%5D2023.11.08~2023.11.21.md#%E5%AF%BC%E5%B8%88%E7%82%B9%E8%AF%84" target="_blank" rel="noreferrer">@RichardWooSJTU</a>、<a href="https://github.com/PFCCLab/Camp/tree/main/WeeklyReports/12_Corle-hyz#%E5%AF%BC%E5%B8%88%E7%82%B9%E8%AF%84" target="_blank" rel="noreferrer">@Caozhou1995</a></li></ul><h4 id="参与提示-2" tabindex="-1">参与提示 <a class="header-anchor" href="#参与提示-2" aria-label="Permalink to &quot;参与提示&quot;">​</a></h4><ul><li>欢迎大家到代码仓库: <a href="https://github.com/PFCCLab/Camp" target="_blank" rel="noreferrer">Camp</a> 里围观集训营的同学们的工作。</li></ul><p>更多详情请查看 issue：<a href="https://github.com/PaddlePaddle/Paddle/issues/57264" target="_blank" rel="noreferrer">https://github.com/PaddlePaddle/Paddle/issues/57264</a></p><h2 id="彩蛋-🎊-欢迎大家线下来见面" tabindex="-1">彩蛋 🎊： 欢迎大家线下来见面 <a class="header-anchor" href="#彩蛋-🎊-欢迎大家线下来见面" aria-label="Permalink to &quot;彩蛋 🎊： 欢迎大家线下来见面&quot;">​</a></h2><p>本周六（12 月 2 日）14:00 - 17:00 在 <strong>北京 798</strong> 举行飞桨开源社区 meetup，报名问卷：<a href="https://paddle.wjx.cn/vm/m1OLk4E.aspx#" target="_blank" rel="noreferrer">https://paddle.wjx.cn/vm/m1OLk4E.aspx#</a> ，欢迎大家来聊天，飞桨定制咖啡等你打卡，梦师傅和花花在咖啡厅等着大家~</p><p><img src="'+n+'" alt="hackathon-5th-pp-coffee"></p>',31)])])}const b=e(d,[["render",i]]);export{u as __pageData,b as default};
